The logical OR operator has incorrect precedence. The expression `(b.wins + b.losses || 1)` will evaluate to 1 when `b.wins + b.losses` is 0, but if the sum is non-zero, it won't provide the intended fallback. Use `(b.wins + b.losses) || 1` instead.
